import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import HomeTwoToneIcon from '@material-ui/icons/HomeTwoTone';
import ForumTwoToneIcon from '@material-ui/icons/ForumTwoTone';
import AlternateEmailTwoToneIcon
  from '@material-ui/icons/AlternateEmailTwoTone';
import SearchTwoToneIcon from '@material-ui/icons/SearchTwoTone';
import PersonOutlineTwoToneIcon from '@material-ui/icons/PersonOutlineTwoTone';
import {useHistory} from 'react-router-dom';

const useStyles = makeStyles(() => ({
  bottom: {
    width: '100%',
    position: 'sticky',
    bottom: 0,
    zIndex: 1302,
  },
}));

/**
 * @return {object} JSX
 */
function LabelBottomNavigation() {
  const classes = useStyles();
  const [value, setValue] = React.useState('recents');
  const history = useHistory();

  const handleChange = (newValue) => {
    setValue(newValue);
  };

  const goToHome = () => {
    console.log('go to Home');
    if (history.location.pathname !== '/homepage') {
      history.push('/homepage');
    }
  };

  const goToMessages = () => {
    console.log('go to messages');
    if (history.location.pathname !== '/messages') {
      history.push('/messages');
    }
  };

  const goToMentions = () => {
    console.log('go to mentions');
    if (history.location.pathname !== '/mentions') {
      history.push('/mentions');
    }
  };

  const goToSearch = () => {
    console.log('go to search');
    if (history.location.pathname !== '/search') {
      history.push('/search');
    }
  };

  const goToProfile = () => {
    console.log('go to profile');
    if (history.location.pathname !== '/profile') {
      history.push('/profile');
    }
  };

  return (
    <BottomNavigation
      value={value}
      onChange={handleChange}
      className={classes.bottom}
    >
      <BottomNavigationAction
        label="Home"
        value="home"
        onClick={goToHome}
        icon={<HomeTwoToneIcon />}
      />
      <BottomNavigationAction
        label="Messages"
        value="messages"
        onClick={goToMessages}
        icon={<ForumTwoToneIcon />}
      />
      <BottomNavigationAction
        label="Mentions"
        value="mentions"
        onClick={goToMentions}
        icon={<AlternateEmailTwoToneIcon />}
      />
      <BottomNavigationAction
        label="Search"
        value="search"
        onClick={goToSearch}
        icon={<SearchTwoToneIcon />}
      />
      <BottomNavigationAction
        label="Profile"
        value="profile"
        onClick={goToProfile}
        icon={<PersonOutlineTwoToneIcon />}
      />
    </BottomNavigation>
  );
}

export default LabelBottomNavigation;
